window.bookSummaryJSON = "<p>Aileen has always been certain of a few undeniable facts - black raspberry is the only ice cream flavor that matters, vampires can't be trusted, and her loyalty, once given, is unquestionable. When a late-night visitor shows up needing her help, she agrees without hesitation.</p> <p>It's not long before a pounding at her door reminds her that nothing is ever as straightforward as it seems. Now, with her friend missing, Aileen realizes her simple favor leads to consequences she cannot avoid as she finds herself drawn further into a world she's done everything to escape.</p> <p>As loyalties are tested, Aileen will need to decide how far she will go in the name of friendship. Because bodies are dropping, and the trail leads right back to one she holds dear. Will she stand fast in her beliefs, or will she be forced to betray another?</p> <p>One thing is clear - her choice may lead to her salvation or her doom.</p>"; 
